export const api = {
  getAllDepartments: `http://localhost:8080/department/get`,
  registrationUrl: "http://localhost:8080/employee/add",
  getCourses: (id) => {
    console.log(id);
    return String(`http://localhost:8080/course_schedule/${Number(id)}/get`);
  },
};
